import './App.css';
import Navbar from './components/Navbar';
import WeatherApp from './WeatherApp';

function App() {

  return (
    <div className="App bg-default h-screen">
      <header className="App-header">
        <Navbar />
        <h1 className='text-center text-5xl tracking-widest font-serif text-stone-300 p-3 cursor-pointer uppercase'>Daily Weather App</h1>
      </header>

      <div className='m-2 p-4'>
        <WeatherApp />
      </div>
    </div>
  );
}

export default App;
